import json

enc_modes = [
    'ENCRYPT_NOT_SUP',
    'ENCRYPT_ON',
    'ENCRYPT_REQ',
    'ENCRYPT_OFF',
    'UNKNOWN'
]

mssql_versions = ['1.0', '1.1',
                  '4.2', '6.0', '6.5', '7.0',
                  '8.0', '9.0', '10.0', '10.2', '10.5', '10.50',
                  '11.0', '12.0', '13.0', '14.0']


def meta_features(machine, field_prefix):
    res = [
            Feature(as_obj={
                '_id': '{}_SUPPORT'.format(field_prefix),
                '_type': 'MACHINE',
                'expansion_safe': True,
                'value': get_field(machine,
                                   '{}_supported'.format(field_prefix),
                                   t='int'),
                'description': 'is {} supported?'.format(field_prefix)
            })
    ]

    res += enumerated_field(machine, field='{}_encrypt_mode'.format(field_prefix), enum_list=enc_modes)
    res += enumerated_field(machine, field='{}_version'.format(field_prefix), enum_list=mssql_versions, version=True)
    return res


def extract(machine, args):
    res = []
    protocol = 'mssql'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)
        res += meta_features(machine, field_prefix)
        res += tls_f.extract(m=machine,
                             args=args,
                             field=field_prefix,
                             _id='p{}_{}'.format(port, protocol))
    return res


